const Speakers = () => {
  const speakers = [
    { src: "images/speaker-component-1124.png", name: "Douglas Crockford" },
    { src: "images/speaker-component-1530.png", name: "" },
    { src: "images/speaker-component-10803.png", name: "" },
  ];

  return <img src="images/speakers.png" alt="" />;
};

export default Speakers;
